  input: '"TEXT","F3XN","C00143743","Transfers shown on Schedule H4 to the non-federal
    account were made for refunds/reimbursements received by the Committee and shown
    on Schedule A Line 15. The reimbursements were made by former employees of the
    Committee for COBRA, in which health insurance payments were made by the Committee
    to Humana.  The reimbursement by the Texas Federation of Republican Women was
    for sub-lease rent and postage. The payments to the vendors (900 Congress and
    Pitney Bowes) are reported within this report. Reimbursements were made either
    prior to the expenditure or within a commercially reasonable time.  The Committee
    also received a refund from Burch Consultants, in which the expenditure was reported
    in January but the seminar was canceled. The Committee notes that items on Schedule
    B are for fundraising activities, not express advocacy for a federal candidate.  The
    Committee also notes that transfers from the non-federal account are for the non-federal
    share of allocable expenditures made during the previous months, but within the
    sixty day window permitted.  In order to comply with the Commissions best efforts
    process, the Committee takes the following steps.  In the Committees initial solicitation,
    the Committee asks each donor for no less than the following information: full
    name, mailing address, occupation and name of employer. Upon receipt of this information,
    the Committee records it for each donor.  Next, within thirty days (normally fifteen
    days) of receipt of a contribution from a donor for which we do not have occupation
    and employer information, we send a letter to the donor that both thanks the donor
    and again requests that the donor provide us with their occupation and employer
    information.  This letter includes a statement about the requirements of federal
    law.  This letter is also accompanied by a self-addressed, stamped envelope.  In
    addition, all information received by the Committee is reported."'
